import React from 'react'
import axios from "axios";

const Dashboard = () => {
    const testQuery = () => {
        axios
            .get("http://localhost:5000/")
            .then((res) => {
                setRandomQuote(res.data);
            });
    };

    return (
        <>
            <h1>Dashboard page</h1>
        </>
    );
  }

export default Dashboard;
